import { Link } from "react-router-dom";
import { Liturgy } from "../Liturgy/Liturgy";

export const Library = () => {
  return (
    <>
      <h1>Library Page</h1>
      <ul>
        <li>
          <Link to="liturgy">
            Liturgy
          </Link>
        </li>
      </ul>

      <Router>
        <Route path element={<Liturgy />}></Route>
      </Router>
    </>
  )
}
